$=jQuery.noConflict(!0);var speed=20;function incElementNumber(e){let n=$(e);incElementNumberRecursive(0,$(e).text(),n)}function incElementNumberRecursive(e,n,t){e<=n&&(t.text(e),setTimeout(function(){incElementNumberRecursive(e+1,n,t)},speed))}function toggleMenu(){$(".nav").toggleClass("nav--active")}$(".nbr").each(function(){incElementNumber(this)}),$(".question").click(function(){let e=$(this).next();e.length>0&&(e.is(":visible")?e.slideUp():e.slideDown())}),$(".menuToggle").click(toggleMenu),$(".menu-item").click(toggleMenu);